bool MiscFunctions::IsEnemyValid(C_BaseEntity *entity, C_BaseEntity* local)
{
	if (!entity)
		return false;

	if (!entity->IsPlayer())
		return false;

	if (entity == local)
		return false;

	if (entity->IsDormant())
		return false;

	if (!entity->IsAlive())
		return false;

	if (entity->GetTeamNum() == local->GetTeamNum())
		return false;

	if (entity->HasGunGameImmunity())
		return false;

	return true;
}
